import React from 'react';
import styled from 'styled-components';
import {SectionTitle} from '../../../components/SectionTitle';
import {font} from '../../../styles/Common';
import {theme} from '../../../styles/Theme';

export const Contacts = () => {
    return (
        <StyledContacts>
            <SectionTitle>Мои контакты</SectionTitle>
            <StyledSubtitle>// Вы можете связаться со мной в удобном для вас мессанджаре или же заполнить форму обратной связи</StyledSubtitle>

        </StyledContacts>
    );
};

const StyledContacts = styled.section`
    width: 80%;
    min-height: 100vh;
    height: fit-content;
    margin: auto;
`;
const StyledSubtitle = styled.h3`
    transform: translateY(-60px);
    text-transform: uppercase;
    ${font({family: '"Montserrat", sans-serif', weight: 400, Fmax: 15, Fmin: 13, color: `${theme.colors.colorGray}`})};
`;
